function arr_to_ascii(arr){
    var ascii = []
    for (var i = 0 ; i < arr.length ; i++){
        val = arr[i].charCodeAt(0)/255 
        ascii.push(val.toPrecision(8))
    }
    if(ascii.length < 58){
        var j = 0
        while (j < 58 - ascii.length){
            ascii.push(0)
        }
    }
    return ascii
}
function standardize(inp){
    s = String(inp)
    a = Array.from(s)
    ascii = arr_to_ascii(a)
    return ascii
}
function get_max(arr){
    var maxs = []
    var pos = -1
    for (var j = 0 ; j < 3 ;j++){
        var max = 0
        for (var i =0 ; i < arr.length ; i++){
            if (arr[i] > max){
                max = arr[i]
                pos = i
            }
        }
        console.log(pos)
        maxs.push(pos)
        arr.splice(pos , 1)
    }
    return maxs
}
